import React from "react";

export default function Navigation() {
  return (
    <div className="nav">
      <ul>
        <li>
          <a href="/">Home</a>
        </li>
        <li>
          <a href="/">Presentations</a>
          <a href="/">Add Presentations</a>
        </li>
      </ul>
    </div>
  );
}
